import { Typography, Button, Grid } from "@mui/material";
import { Box } from "@mui/system";

export const HelloBlock = () => {
  const pages = [
    { text: "EXPLORE", href: "/" },
    { text: "UPLOAD", href: "/create" },
  ];

  return (
    <Grid  container spacing={3} >
      <Grid item xs={12} container justify="center">
      <Grid item xs={11}>
        <Box>
          <Typography align="Center" variant="h5">
            Hello, It's babai NFT marketplace
          </Typography>
        </Box>
      </Grid>
      <Grid item xs={11}>
        <Typography align="Center" variant="h6">
          Here you can explore some NFTS or create your oun
        </Typography>
      </Grid>
      <Grid align="Center" justifyContent="center" item xs={12}>
        <Box
          sx={{
            mt: "1rem",
            display: "flex",
            alignContent: "space-between",
          }}
          align="Center"
        >
          {pages.map((page) => (
            <Button sx={{ mr: "1.5rem" }} variant="contained" href={page.href}>
              {page.text}
            </Button>
          ))}
        </Box>
      </Grid>
      </Grid>
    </Grid>
  );
};
